$(document).ready(function(){
    $("#getFile").change(function() {
        if ($(this)[0].files.length > 0) {
            $("#logoSelected").css("display", "block");
        } else {
            $("#logoSelected").css("display", "none");
        }

        console.log($(this).attr("name"));
    })

    $("#schoolName").change(function() {
        let url = "https://easyschool.academy/bluePreview?schoolName=";
        let schoolName = $(this).val();
        let imgObj = $("#getFile").prop("files")[0];
        let read = new FileReader();
       
        
       
        if (imgObj) {
            read.readAsDataURL(imgObj);
            read.onloadend = function(){
                $(".preview-anchors").attr("href", url + encodeURIComponent(schoolName) + "&image=" + encodeURIComponent(""));
            }
        } else {
            $(".preview-anchors").attr("href", url + encodeURIComponent(schoolName));
        }
      

        

    })
  });